export class Logger {
    sign = '[mlut]';
    info(message, ...args) {
        console.log(this.sign, message, ...args);
    }
    warn(message, ...args) {
        console.warn(this.sign, message, ...args);
    }
    error(message, ...args) {
        console.error(this.sign, message, ...args);
    }
}
export const logger = new Logger();
